import React from 'react';
import Paper from '@material-ui/core/Paper';
import { makeStyles } from '@material-ui/core/styles';

function Items() {
  const useStyles = makeStyles((theme) => ({
    root: {
      width: '40%',
      marginTop: '2%',
      overflowX: 'auto',
      // margin: 'auto',
      marginLeft: '5%',
    },
    table: {
      minWidth: 650,
    },
    button: {
      margin: theme.spacing(1),
    },
    input: {
      display: 'none',
    },
    container: {
      display: 'flex',
      flexWrap: 'wrap',
      backgroundColor: 'white',
      width: 500,
      marginTop: '10%',
      marginLeft: '37%',
    },
    textField: {
      marginLeft: theme.spacing(1),
      marginRight: theme.spacing(1),
      width: 200,
      color: 'white',
    },
    dense: {
      marginTop: 19,
    },
    menu: {
      width: 200,
    },
    schedule: {
      marginLeft: 0,
    },
  }));

  return <Paper>Fridge</Paper>;
}

export default Items;
